    c.deleted_at,
    c.name,
    c.district_id,
    c.mun_vdc_id,
    d.name AS district_name,
    mv.name AS mun_vdc_name
   FROM ((mst_city_places c
     JOIN mst_district_mvs d ON ((c.district_id = d.id)))
     JOIN mst_district_mvs mv ON ((c.mun_vdc_id = mv.id)));


