--
-- Name: view_stock_details; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW view_stock_details AS
 SELECT s.id AS stock_id,
    s.created_by,
    s.updated_by,
    s.deleted_by,
    s.created_at,
    s.updated_at,
    s.deleted_at,
    s.vehicle_id AS stock_vehicle_id,
    s.dispatched_date,
    ms.id AS msil_dispatch_id,
    ms.vehicle_id,
    ms.variant_id,
    ms.color_id,
    ms.dispatch_date,
    ms.barcode,
    ms.engine_no,
    ms.chass_no,
    ms.order_no,
    d.id AS dispatch_dealer_id,
    d.vehicle_id AS dispatch_dealer_vehicle_id,
    d.stock_yard_id,
    d.dealer_id
   FROM ((log_stock_records s
     JOIN msil_dispatch_records ms ON ((s.vehicle_id = ms.id)))
     JOIN log_dispatch_dealer d ON ((s.vehicle_id = d.vehicle_id)));


ALTER TABLE view_stock_details OWNER TO postgres;

--
-- Name: view_stock_yard_stocks; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW view_stock_yard_stocks AS
 SELECT m.id,
    m.created_by,
    m.updated_by,
    m.deleted_by,
    m.created_at,
    m.updated_at,
    m.deleted_at,
    m.vehicle_id,
    m.variant_id,
    m.color_id,
    m.engine_no,
    m.chass_no,
    m.dispatch_date,
    m.month,
    m.year,
    m.order_no,
    m.ait_reference_no,
    m.invoice_no,
    m.invoice_date,
    m.transit,
        CASE
            WHEN (m.transit = 1) THEN 'Transit Complete'::text
            ELSE 'In Transit'::text
        END AS transit_status,
    m.indian_stock_yard,
    m.indian_custom,
    m.nepal_custom,
    m.border,
    m.barcode,
    v.name AS vehicle_name,
    v1.name AS variant_name,
    c.name AS color_name,
    c.code AS color_code,
    l.reached_date AS stock_yard_reached_date,
    l.dispatched_date AS stock_yard_dispatched_date,
    ms.name AS stockyard_name
   FROM (((((msil_dispatch_records m
     LEFT JOIN mst_vehicles v ON ((m.vehicle_id = v.id)))
     LEFT JOIN mst_variants v1 ON ((m.variant_id = v1.id)))
     LEFT JOIN mst_colors c ON ((m.color_id = c.id)))
     LEFT JOIN log_stock_records l ON ((m.id = l.vehicle_id)))
     LEFT JOIN mst_stock_yards ms ON ((l.stock_yard_id = ms.id)))
  WHERE (l.dispatched_date IS NULL);


ALTER TABLE view_stock_yard_stocks OWNER TO postgres;

